import React from 'react';
import './siatka-izometryczna.css';

function Tile() {
  return (
    <div className="tile">
      <div className="tile__top"></div>
      <div className="tile__right"></div>
      <div className="tile__left"></div>
    </div>
  );
}

function Sito() {
  const tiles = [];
  for (let i = 0; i < 10; i++) {
    for (let j = 0; j < 10; j++) {
      tiles.push(<Tile key={`${i}-${j}`} />);
    }
    tiles.push(<br key={`${i}-br`} />);
  }

  return (
    <div className="App">
      {tiles}
    </div>
  );
}

export default Sito;
